export default{
    name:"SellerAccountComponent",
    data()
    {
    return{
        sellerDetail:[]
    }
    },
    mounted()
    {
        getSellerDetails({
            success: ({ data }) => {
                console.log(data)

                this.sellerDetail=data

            },
            error: (e) => {

                console.warn(e);
            }
        })
    }
}
